const Layout = () => {
  const Nav = () => (
    <ul className='nav'>
      <li className='nav-item'>
        <a className='nav-link' href=''>
          Home
        </a>
      </li>
      <li className='nav-item'>
        <a className='nav-link' href=''>
          Login
        </a>
      </li>
      <li className='nav-item'>
        <a className='nav-link' href=''>
          Register
        </a>
      </li>
    </ul>
  );

  return (
    <React.Fragment>
      <Nav />
    </React.Fragment>
  );
};

export default Layout;
